% load datasetdata = csvread('UCI_Credit_Card.csv'); % show dataset data(3434,:)[rows, columns] = size(data);% 10% of the data for testingtest_size = floor(0.1*rows);test = data(1:test_size,2:24);test_label = data(1:test_size,25);% 90% of the data for trainingtrain = data(test_size+1:rows,2:24);train_label = data(test_size+1:rows,25);printf("train data size: %d\n",size(train)(1));printf("Test data size: %d\n",size(test)(1));% Support vector machineprintf("Support vector Machine Result:\n");svm_model = svmtrain(train_label, train);[predict_label, accuracy, dec_values] = svmpredict(test_label, test, svm_model);% compare with other models% Logistic Regressionresult = logistic_regression(train_label,train,1);printf("Accuracy: %d\n",result);